package com.andresrivas.bazpeliculasyseries.domain.modelimport androidx.room.Entityimport androidx.room.PrimaryKeydata class MoviesPagesModel(    val dates: DatesResultModel = DatesResultModel(),    val page: Int = 1,    val resultList: List<MovieModel> = arrayListOf(),    var totalPages: Int = 1,    var totalResults: Int = 0,)@Entitydata class MovieModel(    var id: Int,    var adult: Boolean = false,    var backdropPath: String = "",    // var genreIds: List<Int> = arrayListOf(),    @PrimaryKey    var apiId: String = "",    var originalLanguage: String = "",    var originalTitle: String = "",    var overView: String = "",    var popularity: Double = 0.0,    var posterPath: String = "",    var releaseDate: String = "",    var title: String = "",    var video: Boolean = false,    var voteAverage: Double = 0.0,    var voteCount: Double = 0.0,)data class DatesResultModel(    val maximum: String = "",    val minimum: String = "",)